import React from "react";

export default function CompanyProspectList({ data }) {
  console.log("Props reçues :", data);

  return (
    <div>
      <h2>Liste des entreprises :</h2>
      {data.map((e, i) => (
        <div key={i} style={{ border: "1px solid black", padding: "10px", margin: "5px 0" }}>
          <strong>{e.nom}</strong> — {e.secteur}
          <p>{e.adresse}</p>
          <p>{e.resume}</p>
        </div>
      ))}
    </div>
  );
}
